import axios from './customize-axios'

const fetchAllUser = () => {
    return axios.get("/all-user")
}

const addNewAccount = (userData) => {
    return axios.post("/create-user", userData)
}

const editAccount = (name, phone) => {
    return axios.put("/user", {name, phone})
}

const deleteAccount = (_id) => {
    return axios.delete(`/users/${_id}`)
}

export { fetchAllUser, addNewAccount, editAccount, deleteAccount }
